import React from 'react';
import { Link } from 'react-router-dom';
import { Stack } from '@mui/material';
import Logo from '../assets/images/Logo.png'; // Corrected import path

const Navbar = () => {
  return (
    <div>
      <img src={Logo} alt="Logo" />
      Navbar
    </div>
  );
}

export default Navbar;
